import { BrowserRouter as Router, Route, Switch, Redirect } from "react-router-dom";
import "./style/tailwind.css";
import "./style/style.css";
import Login from './components/Login/login';
import Navbar from './components/base/navbar';
import UserSeries from "./components/userData/userSeries";
import AuthService from "./services/auth-service";
import { useState } from "react";

function App() {

    const [logged, setLogged] = useState(false);

    if (AuthService.getCurrentUser() !== null ||Â AuthService.getCurrentUser() !== undefined) {
        setLogged(true);
    }

    return (
        <Router>
            <Navbar />
            <Switch>
                <Route exact path="/"><Redirect to="/home" /></Route>
                <Route exact path="/home" component={logged === true ? UserSeries : Login} />
                <Route exact path="/series" component={UserSeries} />
                <Route render={() => <Redirect to="/home" />} />
            </Switch>
        </Router>
    );
}

export default App;
